import { useState,useEffect} from 'react';

function App(props) {

  let [count, setCount] = useState(0);

  function clickHandle() {
    setCount(++count);
  }


  return (
    <div>
      <div>计数: {count}</div>

      <button onClick={clickHandle}>+1</button>
    </div>
  );
}

export default App;
